import React from 'react';
import './UserProfile.css';

const UserProfile = () => {
    return (
        <div className="user-profile">
            <div className="profile-header">
                <h1>Profile</h1>
                <p>Your profile information will be displayed here</p>
            </div>
        </div>
    );
};

export default UserProfile;
